(268, 4, '2015-10-01 09:32:53', 'Episode VI: Return of Imagine Commerce | 2016 Registration is Open!', 'The force is strong with this one. Join the Magento rebellion at Imagine Commerce 2016. Enlist Now at http://imagine.magento.com.', 'http://imagine.magento.com', 0, 0),
(269, 1, '2015-10-20 16:28:05', 'New Malware Issue. Make Sure You Have Implemented All Security Patches', 'We have received reports that some Magento sites are being targeted by Guruincsite malware (Neutrino exploit kit). We have NOT identified a new attack vector at this time. Nearly all the impacted sites checked so far were vulnerable to a previously identified and patched issue; sites not vulnerable to that issue show other unpatched issues. Visit the Magento Security Center at http://magento.com/security/news/important-security-update for more information on how to address this issue and make sure that you have implemented all recent security patches.\n', 'http://magento.com/security/news/important-security-update', 0, 0),
(270, 1, '2015-10-27 13:48:23', 'October 27, 2015: New Magento Security Patch (SUPEE-6788) – Install Immediately', 'Today, we are releasing a new patch (SUPEE-6788) and Community Edition 1.9.2.2 to address 10+ security issues, including remote code execution and information leak vulnerabilities. This patch is unrelated to the Guruincsite malware issue. Be sure to test the patch in a development environment first, as it can affect extensions and customizations. Download the patch from the Community Edition Download page and learn more at http://magento.com/security/patches/supee-6788  ', 'http://magento.com/security/patches/supee-6788  ', 0, 0),
(271, 1, '2015-11-17 16:25:00', 'New JavaScript Malware Issue. Make sure your site is secure.', 'Magento Commerce has received reports of a JavaScript malware exploit that forwards credit card information from checkout pages to an external site. No new attack vector has been identified. It appears most impacted sites have not implemented the February 2015 Shoplift patch, or the patch was implemented after the site was already compromised. Information on how to identify and remove the malicious code is available on the Magento Security Center at http://magento.com/security/news/new-javascript-malware-issue', 'http://magento.com/security/news/new-javascript-malware-issue ', 0, 0),
(272, 4, '2015-11-18 13:40:40', 'Magento 2.0 Is Available!', 'Magento 2.0, our next generation open source digital commerce platform is here!  Magento 2.0 offers enhanced performance and scalability, new features to deliver better shopping experiences and conversion rates, and business agility and productivity improvements.  Learn more http://magento.com/blog/magento-news/new-era-commerce-innovation.\n\n', 'http://magento.com/blog/magento-news/new-era-commerce-innovation', 0, 0),
(273, 4, '2016-01-13 14:51:52', 'Have questions? Magento has big answers at Imagine Commerce.', 'Big news, bigger experts, and an even bigger ecosystem. Will you be at Imagine Commerce? Join us. ', 'http://imagine.magento.com', 0, 0),
(274, 1, '2016-01-20 14:17:19', 'Important: New Security Patch (SUPEE-7405) and Release – 1/20/2016', 'Today, we are releasing a new patch (SUPEE-7405) and Community Edition 1.9.2.3 to improve the security of Magento sites. There are no confirmed attacks related to the security issues, but certain vulnerabilities can potentially be exploited to access customer information or take over administrator sessions. You can download the patch and release from the Community Edition Download Page and learn more at https://magento.com/security/patches/supee-7405. ', 'https://magento.com/security/patches/supee-7405', 0, 0),
(275, 1, '2016-02-24 00:06:43', 'Important: Updates to SUPEE-7405 Security Patch and Release – 2/23/2016', 'Updated versions of the recent SUPEE-7405 patch and Community Edition 1.9.2.3 release are now available. The updates add support for PHP 5.3 and address issues with upload file permissions, merging carts, and SOAP APIs experienced with the original release. They DO NOT address any new security issues, but all merchants should upgrade to the new versions to maintain compatibility with future releases. You can learn more about the updates at https://magento.com/security/patches/supee-7405', 'https://magento.com/security/patches/supee-7405', 0, 0),
(276, 1, '2016-03-30 16:25:07', 'Protect Your Business from Brute-Force Password Guessing Attacks', 'We just posted an article on the Magento Security Center that shares best practices for protecting stores from brute-force password guessing attacks. We’ve recently been made aware of a rise in these attacks, so we strongly recommend that you review the approaches outlined in this article with your developer and hosting provider immediately and implement the ones that are best suited to your unique situation. Learn more at https://magento.com/security/best-practices/protect-your-magento-installation-password-guessing ', 'https://magento.com/security/best-practices/protect-your-magento-installation-password-guessing ', 0, 0),
(277, 4, '2016-06-23 08:44:34', 'Increase your sales and productivity, while simplifying PCI compliance with exciting new Magento Community Edition 2.1 features.', 'Shoppers can now check out faster using credit cards stored with PayPal and a redesigned PayPal checkout. PCI compliance is easier thanks to Braintree Hosted Fields. Admin tools are redesigned to help you work more efficiently. Upgrade to Enterprise Edition for new Content Staging and Preview and Enhanced Site Search capabilities.', 'https://magento.com/blog/magento-news/magento-enterprise-edition-21-unleashes-power-marketers-and-merchandisers ', 0, 0),
(278, 1, '2016-10-12 12:30:13', 'Community Edition 1.9.3 and SUPEE-8788 Provide Critical Security & Functional Updates – 10/12/2016', 'Community Edition 1.9.3 and SUPEE-8788 resolve multiple security issues, including critical vulnerabilities with certain payment methods and Zend Framework libraries. Community Edition 1.9.3 also includes over 120 product quality enhancements and support for PHP 5.6. Learn more about the security issues at https://magento.com/security/patches/supee-8788 and functional updates at http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html#ce19-1930 ', 'https://magento.com/security/patches/supee-8788 ', 0, 0),
(279, 1, '2016-10-25 08:51:10', 'Dirty COW Linux OS Vulnerability – 10/25/2016', 'Dirty COW (CVE-2016-5195) is a serious vulnerability affecting most Linux Operating Systems that can be exploited to gain root access to the server. More information on how to immediately update your Linux OS is available in the Magento Security Center at https://magento.com/security/vulnerabilities/new-linux-operating-system-vulnerability. ', 'https://magento.com/security/vulnerabilities/new-linux-operating-system-vulnerability', 0, 0),
(280, 4, '2016-11-14 13:08:04', 'Community Edition 1.9.3.1 is Now Available – 11/14/2016', 'Community Edition 1.9.3.1 addresses issues encountered by some merchants in our October 12 product releases. All merchants should either upgrade to Community Edition 1.9.3.1 or apply our latest patch, SUPEE-8788, to close several serious security vulnerabilities. More information is available in the release notes at: http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html#ce19-1931 ', 'http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html#ce19-1931 ', 0, 0),
(281, 1, '2017-01-13 18:33:20', 'New Zend Framework Security Vulnerability – 1/13/2017', 'We’ve found a new vulnerability in a Zend Framework 1 and 2 email component used by all Magento 1 and Magento 2 software (as well as other PHP solutions). This vulnerability is serious and can lead to a remote code execution attack if your servers use Sendmail as a mail transport agent. Learn how to protect your sites at https://magento.com/security/news/new-zend-framework-1-security-vulnerability\n\n', 'https://magento.com/security/news/new-zend-framework-1-security-vulnerability', 0, 0),
(282, 4, '2017-01-19 08:58:24', 'New Magento DevBox Beta Speeds Magento 2 Setup – 1/19/2017', 'Magento DevBox Beta makes it faster and easier than ever to setup your Magento 2 development environment. Read our blog post to find out more at: https://magento.com/blog/technical/set-your-magento-2-development-environment-faster.', 'https://magento.com/blog/technical/set-your-magento-2-development-environment-faster', 0, 0),
(283, 1, '2017-02-07 12:03:15', 'Community Edition 1.9.3.2 and SUPEE-9652 Resolve Zend Framework Security Issue – 2/7/2017', 'Community Edition 1.9.3.2 and the SUPEE-9652 patch resolve the recent Zend Framework 1 Security vulnerability. Review the Magento Security Center post for more information:  https://magento.com/security/patches/supee-9652', 'https://magento.com/security/patches/supee-9652', 0, 0),
(284, 4, '2017-02-17 13:07:28', 'Inspirational athlete, Serena Williams, will join Magento at Imagine 2017.', 'Imagine 2017 will bring together 3000+ international commerce experts to exchange ideas on the future of commerce. Don’t miss this opportunity to hear from inspirational athlete, Serena Williams, and Stella & Dot CEO, Jessica Herrin. Join us in Las Vegas, April 3-5. Register Now at https://imagine.magento.com/\n', 'https://imagine.magento.com/', 0, 0),
(285, 1, '2017-05-31 12:03:50', 'Community Edition 1.9.3.3 and SUPEE-9767 Security Enhancements – 5/31/2017', 'Community Edition 1.9.3.3 and SUPEE-9767 includes critical security enhancements. Review the Security Center update for more information: https://magento.com/security/patches/supee-9767', 'https://magento.com/security/patches/supee-9767', 0, 0),
(286, 2, '2017-06-13 10:20:53', 'New Patch for PayPal Instant Payment Notification (IPN) Changes. Upgrade to 1.9.3.3 or SUPEE-8167 by June 30, 2017 to Avoid Service Disruptions – 6/13/2017', 'As of June 30, 2017, PayPal Instant Payment Notifications will no longer allow you to use HTTP to post messages back to PayPal for verification. To comply with these changes, all merchants using PayPal must upgrade to Community Edition 1.9.3.3 or apply the SUPEE-8167 patch. Updates must be in place by June 30, 2017 to avoid any service disruptions. The patch is available on the Community Edition Download Page (https://magento.com/tech-resources/download) and more information is available from PayPal at https://www.paypal-knowledge.com/infocenter/index?page=content&widgetview=true&id=FAQ1916&viewlocale=en_US\n\n', 'https://magento.com/tech-resources/download ', 0, 0),
(287, 4, '2017-07-05 01:25:37', 'Magento Business Intelligence Essentials: Now Available!', 'Magento Business Intelligence Essentials (BI) helps you and your teams to stay on top of the most important metrics to your business. Essentials works directly with your Magento order and customer data, and provides business insights far beyond what standard web analytics tools provide.\n\nWith Essentials, you can get up and running in only a few minutes and access over 75 pre-built reports instantly. Plus, it comes with a free 7-day trial where no credit card information is required. If you decide to stay, Essentials starts at just $100/month.\n\nFor more information, visit magento.com/products/business-intelligence/essentials.\n', 'https://magento.com/products/business-intelligence/essentials', 0, 0);
INSERT INTO `tbl_adminnotification_inbox` (`notification_id`, `severity`, `date_added`, `title`, `description`, `url`, `is_read`, `is_remove`) VALUES
(288, 1, '2017-07-12 10:15:32', 'Community Edition 1.9.3.4 and SUPEE-9767 Version 2 Address Issues with May 31 Security Release', 'Community Edition 1.9.3.4 and SUPEE-9767 v2 (patch) are now available. The new release and updated patch address customer registration and other issues encountered by some merchants when using the original release. Please upgrade as soon as possible to keep your site secure. More information is available in the release notes at  http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html', 'http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html', 0, 0),
(289, 4, '2008-11-07 20:46:42', 'Reminder: Change Magento`s default phone numbers and callouts before site launch', 'Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.', '', 0, 0),
(290, 4, '2008-11-07 20:46:42', 'Reminder: Change Magento`s default phone numbers and callouts before site launch', 'Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.', '', 0, 0),
(291, 4, '2008-11-07 20:46:42', 'Reminder: Change Magento`s default phone numbers and callouts before site launch', 'Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.', '', 0, 0),
(292, 1, '2018-09-06 07:22:45', 'Magento Open Source 1 software security patches thru June 2020', 'Magento Open Source 1 software security patches thru June 2020\n\nFor Magento Open Source 1.5 to 1.9, we are providing software security patches through June 2020 to ensure those sites remain secure and compliant. Visit our information page for more details about our software maintenance policy and other considerations for your business.\n\nhttps://info2.magento.com/M1OpenSource.html\n', 'https://info2.magento.com/M1OpenSource.html', 0, 0),
(293, 1, '2018-09-18 15:21:37', 'Magento Open Source 2.2.6 delivers important security updates along with performance and functionality enhancements – 9/18/2018', 'The latest release of Magento Open Source includes important security enhancements along with performance and functionality improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. For more information about security updates included in these versions of Magento please see our Security Center: https://magento.com/security/patches/magento-2.2.6-and-2.1.15-security-update', 'https://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html', 0, 0),
(294, 2, '2018-09-27 07:49:45', 'PHP 7.2 support patches are now available for Magento 1', 'PHP 7.2 support patches for Magento 1 are now available. It is critical you are on a supported version of PHP to ensure your site is secure and in compliance. For compatibility and download details, please visit our developer forum post.\n\nhttps://community.magento.com/t5/News-Announcements/PHP-7-2-Support-Patches-for-Magento-1-are-now-available/m-p/106999#M211', 'https://community.magento.com/t5/News-Announcements/PHP-7-2-Support-Patches-for-Magento-1-are-now-available/m-p/106999#M211', 0, 0),
(295, 1, '2018-11-28 13:03:26', 'Magento Commerce 1.9.4.0 adds PHP 7.2 support along with security enhancements – 11/28/2018', 'The latest release of Magento Open Source 1 adds support for PHP 7.2 and delivers important security enhancements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about these enhancements. For more information about security updates included in this version of Magento please see our Security Center: https://magento.com/security/patches/supee-10975', 'https://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html', 0, 0),
(296, 1, '2019-03-01 12:19:27', 'Action required: Update Authorize.Net Direct Post from MD5 to SHA-512 – 3/1/2019', 'Magento\'s implementation of the Authorize.Net Direct Post payment method uses MD5 based hash, and on March 14, 2019 Authorize.net will stop supporting MD5 based hash usage. This will result in Magento merchants not being able to process payments using Authorize.Net Direct Post. To avoid disruption and to continue processing payments, merchants need to apply a patch provided by Magento and add a Signature Key (SHA-512) in the Magento Admin configuration settings. For information on applying this patch please see the Magento Help Center.\n\nhttps://support.magento.com/hc/en-us/articles/360024368392', 'https://support.magento.com/hc/en-us/articles/360024368392', 0, 0),
(297, 1, '2019-03-26 10:05:45', 'Magento Open Source 1.9.4.1 released with important security enhancements – 3/26/2019', 'The latest release of Magento Open Source 1 delivers important security enhancements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about these enhancements. For more information about security updates included in this version of Magento please see our Security Center: https://magento.com/security/', 'https://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html', 0, 0),
(298, 1, '2019-06-25 08:08:15', 'Important Security and Performance Updates Released in Magento 2.3.2  ', 'The latest releases of Magento include important security enhancements, along with performance and productivity improvements. We strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements and information on security updates included in these versions of Magento at our Security Center: https://magento.com/security/', 'https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html', 0, 0),
(299, 4, '2019-08-01 13:21:52', 'Ready, Set, Grow! Check out our five best practices for ensuring your eCommerce platform has the necessary scalability.', 'The future is full of opportunity, but your eCommerce platform has to be ready for it. We’ve got five best practices to ensure your platform has what it takes to grow with your business. Download guide here: http://bit.ly/2YFTrsI', 'http://bit.ly/2YFTrsI', 0, 0),
(300, 4, '2019-08-07 15:24:38', '6 Must-Haves for a Fast, Flexible eCommerce Platform', 'The future of digital eCommerce is knocking. You\'ll need a competitive eCommerce platform which meets escalating operational demands and consumer experience expectations. Download eBook here: http://bit.ly/315BbGI', 'http://bit.ly/315BbGI', 0, 0),
(301, 4, '2019-09-24 08:05:05', 'Experience cost-effective revenue growth with Magento Commerce 2 ', 'Discover recent customer research revealing a 165% boost in ROI after upgrading to M2. Learn how migrating can boost your business value by downloading the full report: http://bit.ly/2lIWONN', 'http://bit.ly/2lIWONN', 0, 0),
(302, 4, '2019-09-26 13:11:01', 'New study shows ROI of 165% after upgrading to Magento Commerce 2. ', 'Be prepared for 2020. See what Magento Commerce 2 can do for you with a free ROI evaluation. Sign up today: http://bit.ly/2kyYMA9', 'http://bit.ly/2kyYMA9', 0, 0),
(303, 4, '2019-10-01 07:34:14', 'Do you need to plan for future growth, but spend most of your time managing day-to-day operations?', 'Our guide to fast-track business planning can help you prepare for tomorrow, even as you meet deadlines today. Get guide here: http://bit.ly/2odHie3', 'http://bit.ly/2odHie3', 0, 0),
(304, 4, '2019-10-08 10:54:54', 'It’s time to get your digital business out of the slow lane.', 'Accelerate your revenue growth and drive customer satisfaction with these 5 must-have eCommerce features. Download this informative guide: http://bit.ly/2og3g0q', 'http://bit.ly/2og3g0q', 0, 0),
(305, 1, '2019-10-09 11:59:35', 'Magento Open Source 2.3.3 delivers important security updates along with performance and functionality enhancements – 10/9/2019 ', 'The latest release of Magento Open Source 2.3.3, Magento Open Source 2.2.10 and our new security-only patch 2.3.2-p2 are now available. Magento Open Source 2.3.3 includes important security enhancements along with new features, improved performance, and quality. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. For more information about security updates included in these versions of Magento please see our Security Center: https://magento.com/security/', 'https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html', 0, 0),
(306, 4, '2019-10-16 05:52:13', 'You are invited: The True Cost Savings of Magento Commerce Webinar', 'Join other Magento Open Source customers for a live webinar on October 30th with commerce experts Matthew Boland and John Glasgow from Adobe to learn how upgrading from Open Source to Magento Commerce can trim your costs and deliver major ROI. Register today: http://bit.ly/31arLcK', 'http://bit.ly/31arLcK', 0, 0);

