(1, 'PBA TOYATA VS CRISPA GAME#1', 0, '<p>The rivalry was preceded by that between Crispa and the MERALCO Reddy Kilowatts in the Manila Industrial Commercial Athletic Association (MICAA) in 1971 when both teams disputed the MICAA All-Filipino and MICAA Open championships, respectively won by Crispa and MERALCO. After the MERALCO team disbanded in 1972, most of its former players went on to form the core of a new team, the Komatsu Komets (later renamed, Toyota Comets) in 1973. The rivalry began during the 1974 MICAA All-Filipino when both teams met for their first championship showdown on October 1974. The Redmanizers closed the gap in the final 42 seconds to win, 103-99, on October 15, 1974, before a crowd of 14,000 at the Araneta Coliseum. Interestingly, both teams were not supposed to settle the title. During the semi-final round of that tournament, the Toyota Comets and the U/Tex Weavers were disputing their place for the finals. U/Tex player Danny Florencio hit a controversial buzzer-beating layup that gave U/Tex the win over Toyota, coming from 20 points down with 7 minutes remaining. U/Tex earned the right to face Crispa for the championship. However, Toyota placed the game under protest and the MICAA officials ordered a rematch. U/Tex refused to play and defaulted the rematch, paving the way for first-ever championship meeting between Crispa and Toyota. This was to be the last tournament of the \"old MICAA\". The MICAA lost its prominence in basketball with the founding of the professional Philippine Basketball Association (PBA) in early 1975.</p>', 'jaworski-accordion.jpg', '1'),
(2, 'CAVS VS WARRIORS', 0, '<p>The Warriors were even more dominant in their trip to a third straight Finals appearance &ndash; beating opponents by an average of 16.3 points per. Of course, getting past San Antonio wasn&rsquo;t quite as tall a task sans one of the league&rsquo;s top two-way stars &ndash; Kawhi Leonard &ndash; who went down with the Spurs leading by 26 points in Game 1. (Not to mention the absence of Tony Parker.)</p>\r\n<p>Injuries are a part of the Playoffs &ndash; and have been a factor in the Finals over the past two seasons. Cleveland limped into the 2015 Finals &ndash; with Kevin Love missing the entire series and Kyrie Irving, lost in overtime of Game 1. Last year, the Warriors lost Andrew Bogut to a left knee injury early in Game 5.</p>\r\n<p>But in this year&rsquo;s title trilogy, both squads are rested, ready and red-hot &ndash; with the Wine &amp; Gold suffering just a single hiccup along the way and the Warriors going unblemished through a dozen Western Conference matchups.</p>', 'cavs-vs-warriors-nba-finals-2017-h.jpg', '6');

